import React from 'react';
import Button from 'react-bootstrap/Button';
import './NotFound.css';

const NotFound = () => {
    return(
        <div className="not-found-container">
            <p id="page404-code"> 404
                <div id="page404-text">
                    It appears that the image you are looking for is not available.
                </div>
            </p>

        </div>
    )
}

export default NotFound;
